class Openai:
    def __init__(self):
        self.api_url = 'https://openai.proxy/v1/audio/speech'
        self.headers = {"Content-Type": "application/json"}
        self.device = torch.device("cuda" if torch.cuda.is_available() else "cpu")

    def generate_speech(self, text_input):
        data = {
            "model": "tts-1-hd",
            "input": text_input,
            "voice": "alloy"
        }


        response = requests.post(self.api_url, json=data, headers=self.headers)


        if response.status_code == 200:
            # Load the audio data from the response as a .wav file
            audio_data = io.BytesIO(response.content)
            waveform, sample_rate = torchaudio.load(audio_data, format="wav")


            if sample_rate != 16000:
                resampler = torchaudio.transforms.Resample(orig_freq=sample_rate, new_freq=16000)
                waveform = resampler(waveform)


            waveform = waveform.to(self.device)

            return waveform
        else:
            raise Exception(f"Failed to generate speech: {response.text}")

